<svg id="Layer_1" data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 1366 1214.99"><defs><style>.cls-1,.cls-2{font-size:22px;}.cls-1,.cls-2,.cls-4{fill:#fff;}.cls-1{font-family:Obviously-Semi, Obviously;letter-spacing:-0.04em;}.cls-2{font-family:Obviously-Regu, Obviously;}.cls-3{fill:none;stroke:#ff0;stroke-miterlimit:10;stroke-width:5px;}.cls-4{font-size:19px;font-family:Obviously-Thin, Obviously;font-weight:200;}</style></defs><text class="cls-1" transform="translate(129.64 121.68)">IDENTITY DISRUPTION (2020)</text><text class="cls-2" transform="translate(129.64 175.69)">Identity Disruption is a collection of stories told <tspan x="0" y="26.4">by people who feel that their identity disrupts the </tspan><tspan x="0" y="52.8">standards set by the society that surrounds them.</tspan></text><polyline class="cls-3" points="109.5 428.5 83.5 428.5 83.5 105 109.5 105"/><text class="cls-4"><tspan x="129.64" y="299.96">I had conversations with each of them and discussed </tspan><tspan x="129.64" y="322.76">how they experience the risk that their disruptive iden</tspan><tspan x="726.65" y="322.76">-</tspan><tspan x="129.64" y="345.56">tity may put them in.</tspan><tspan x="129.64" y="391.16">Then, each of them thought of an artifact that would </tspan><tspan x="129.64" y="413.96">help them confront the risk that they face or help </tspan><tspan x="129.64" y="436.76">others in similar situations. </tspan><tspan x="129.64" y="482.36">These artifacts stem from a range of protection, pride, </tspan><tspan x="129.64" y="505.16">anger, and fear. The purpose of this is to show the ways </tspan><tspan x="129.64" y="527.96">that people of different backgrounds and experiences </tspan><tspan x="129.64" y="550.76">may face the world when they do not fit the Western </tspan><tspan x="129.64" y="573.56">standard of who and what they should be.</tspan></text><image width="1284" height="796" transform="translate(129.18 779.04) sca
